import React, { Component } from "react";

//Stateless Functional Component

const NavBar = ({ totalCounters }) => {
  return (
    <div class="jumbotron jumbotron-fluid">
      <div class="container">
        margin-bottom: 0px; background-image: "./coco.png"; background-position:
        0% 25%; background-size: cover; background-repeat: no-repeat; color:
        white; text-shadow: black 0.3em 0.3em 0.3em;
        <h1 class="display-4">Olá olé</h1>
        <p class="lead">Putas, tudo putas</p>
      </div>
    </div>
  );
};

export default NavBar;
